import React, { Fragment } from 'react';
import { Typography } from '@material-ui/core';

const TopDashBoard = props => {
    return (
        <Fragment>
            <Typography variant='h5'>Good morning, She Fen</Typography>
            <Typography variant='body1'>Here's what's happening</Typography>
        </Fragment>
    );
};
export default TopDashBoard;
